import React, { useState, useEffect } from 'react';
import { getServerData } from '../helper/helper';

export default function NonTableResultView() {
    const [data, setData] = useState([]);

    useEffect(() => {
        getServerData('http://localhost:5000/api/result', (res) => {
            setData(res);
        });
    }, []);

    return (
        <div className="non-table-result-view">
            <h2>Results</h2>
            {data.length === 0 ? (
                <p>No results found.</p>
            ) : (
                <ul>
                    {data.map((result, index) => (
                        <li key={index}>
                            <strong>Name:</strong> {result.username},{' '}
                            <strong>Attempts:</strong> {result.attempts},{' '}
                            <strong>Marks:</strong> {result.points},{' '}
                            <strong>Result:</strong> {result.achieved}
                        </li>
                    ))}
                </ul>
            )}
        </div>
    );
}
